From the award-winning director Joone comes the bigest epic in the history of adult films. This electrifying, swashbuckling sex-adventure takes you on a humorous and mystical journey through haunted seas and deep into the abyss of our most lustful desires...
Pirates features deadly swordplay against skeleton warriors, Jesse Jane in her first girl/girl scene with Janine &amp; Carmen Luvana, dirty pirate whores (Teagan Presley, Devon, Jenaveve Jolie and many more), awe-inspiring Incan magic, grandiose sea battles, loads of special features &amp; hot extras within a 3 disc set, and 10 of the most arousing sex scenes in the history of erotic cinema!
